var el4269 = document.createElement('script');
el4269.text = "\n        // \"use strict\";\n        /*-----------------------------------------------texturalTrianglePlot----------------------------------------------*/\n        //import {barycentric, ternaryPlot} from \"@julesblm/d3-ternary\"\n        let { barycentric, ternaryPlot } = d3;\n      \n        let values;\n      \n        const width = 600;//600;\n        const height = width;\n        const radius = width / 2;\n      \n        const ternarySoil = barycentric()\n          .a((d) =\u003e d.silt)\n          .b((d) =\u003e d.clay)\n          .c((d) =\u003e d.sand);\n      \n        const _textureTernaryPlot = ternaryPlot(ternarySoil)\n          .radius(radius)\n          .domains([\n            [1, 0],\n            [1, 0],\n            [1, 0],\n          ])\n          .labels([\"Silt Separate, %\", \"Clay Separate, %\", \"Sand Separate, %\"])\n          .labelAngles([60, -60, 0])\n          .labelOffsets([100, 100, 100])\n          .tickAngles([-60, 0, 60])\n          .tickTextAnchors([\"start\", \"end\", \"start\"]);\n      \n        const _yOffset = height / 2 + _textureTernaryPlot.radius() / 4;\n      \n        const _divisions = [\n          {\n            texture: \"Silt\",\n            color_val: \"#35d030\",\n            values: [\n              { clay: 0, sand: 20, silt: 80 },\n              { clay: 12, sand: 8, silt: 80 },\n              { clay: 12, sand: 0, silt: 88 },\n              { clay: 0, sand: 0, silt: 100 },\n              { clay: 0, sand: 20, silt: 80 },\n            ],\n          },\n      \n          {\n            texture: \"Silt loam\",\n            color_val: \"#82d901\",\n            values: [\n              { clay: 0, sand: 20, silt: 80 },\n              { clay: 0, sand: 50, silt: 50 },\n              { clay: 27, sand: 23, silt: 50 },\n              { clay: 27, sand: 0, silt: 73 },\n              { clay: 12, sand: 0, silt: 88 },\n              { clay: 12, sand: 8, silt: 80 },\n              { clay: 0, sand: 20, silt: 80 },\n            ],\n          },\n          {\n            texture: \"Loam\",\n            color_val: \"#cea600\",\n            values: [\n              { clay: 7, sand: 43, silt: 50 },\n              { clay: 7, sand: 52, silt: 41 },\n              { clay: 20, sand: 52, silt: 28 },\n              { clay: 27, sand: 45, silt: 28 },\n              { clay: 27, sand: 23, silt: 50 },\n              { clay: 7, sand: 43, silt: 50 },\n            ],\n          },\n          {\n            texture: \"Sand\",\n            color_val: \"#ffc88b\",\n            values: [\n              { clay: 0, sand: 100, silt: 0 },\n              { clay: 10, sand: 90, silt: 0 },\n              { clay: 0, sand: 85, silt: 15 },\n              { clay: 0, sand: 100, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Loamy sand\",\n            color_val: \"#fcc2ca\",\n            values: [\n              { clay: 10, sand: 90, silt: 0 },\n              { clay: 15, sand: 85, silt: 0 },\n              { clay: 0, sand: 70, silt: 30 },\n              { clay: 0, sand: 85, silt: 15 },\n              { clay: 10, sand: 90, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Sandy loam\",\n            color_val: \"#f8c7e9\",\n            values: [\n              { clay: 20, sand: 80, silt: 0 },\n              { clay: 20, sand: 52, silt: 28 },\n              { clay: 7, sand: 52, silt: 41 },\n              { clay: 7, sand: 43, silt: 50 },\n              { clay: 0, sand: 50, silt: 50 },\n              { clay: 0, sand: 70, silt: 30 },\n              { clay: 15, sand: 85, silt: 0 },\n              { clay: 20, sand: 80, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Clay loam\",\n            color_val: \"#bce83b\",\n            values: [\n              { clay: 40, sand: 45, silt: 15 },\n              { clay: 40, sand: 20, silt: 40 },\n              { clay: 27, sand: 20, silt: 53 },\n              { clay: 27, sand: 45, silt: 28 },\n              { clay: 40, sand: 45, silt: 15 },\n            ],\n          },\n          {\n            texture: \"Sandy clay loam\",\n            color_val: \"#fc829b\",\n            values: [\n              { clay: 35, sand: 65, silt: 0 },\n              { clay: 35, sand: 45, silt: 20 },\n              { clay: 27, sand: 45, silt: 28 },\n              { clay: 20, sand: 52, silt: 28 },\n              { clay: 20, sand: 80, silt: 0 },\n              { clay: 35, sand: 65, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Sandy clay\",\n            color_val: \"#fa2302\",\n            values: [\n              { clay: 55, sand: 45, silt: 0 },\n              { clay: 35, sand: 45, silt: 20 },\n              { clay: 35, sand: 65, silt: 0 },\n              { clay: 55, sand: 45, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Clay\",\n            color_val: \"#f4f988\",\n            values: [\n              { clay: 100, sand: 0, silt: 0 },\n              { clay: 55, sand: 45, silt: 0 },\n              { clay: 40, sand: 45, silt: 15 },\n              { clay: 40, sand: 20, silt: 40 },\n              { clay: 60, sand: 0, silt: 40 },\n              { clay: 100, sand: 0, silt: 0 },\n            ],\n          },\n          {\n            texture: \"Silty clay\",\n            color_val: \"#a0e1c0\",\n            values: [\n              { clay: 60, sand: 0, silt: 40 },\n              { clay: 40, sand: 20, silt: 40 },\n              { clay: 40, sand: 0, silt: 60 },\n              { clay: 60, sand: 0, silt: 40 },\n            ],\n          },\n          {\n            texture: \"Silty clay loam\",\n            color_val: \"#5ed7a7\",\n            values: [\n              { clay: 40, sand: 0, silt: 60 },\n              { clay: 40, sand: 20, silt: 40 },\n              { clay: 27, sand: 20, silt: 53 },\n              { clay: 27, sand: 0, silt: 73 },\n              { clay: 40, sand: 0, silt: 60 },\n            ],\n          },\n        ];\n      \n        const _ternaryDivisions = _divisions.map((d) =\u003e {\n          // add centroid for label position to each division\n          const centroid = d3.polygonCentroid(d.values.map(_textureTernaryPlot));\n          const coords = d.values.map(_textureTernaryPlot);\n          const colors = d.color_val;//.map(_textureTernaryPlot);\n          const center = _textureTernaryPlot.invert(centroid);\n      \n          return {\n            ...d,\n            coords,\n            centroid,\n            center: { clay: center[0], sand: center[1], silt: center[2] },\n          };\n        });\n        const _closedLine = d3.line().curve(d3.curveLinearClosed);\n      \n        const _gridLines = _textureTernaryPlot\n          .gridLines()\n          .map((axisGrid) =\u003e axisGrid.map(d3.line()).join(\" \"));\n      \n        const _format =\n        d3.format(\".2%\");\n      ";
